import React from 'react'

import FamiliaMenbro from './FamiliaMenbro'

export default props => {

    return(
        <div>
            <FamiliaMenbro nome="Joao Pedro" sobrenome={props.sobrenome}/>
            <FamiliaMenbro nome="Joao Victor" {...props}/>
            <FamiliaMenbro nome="Joao Lucatto" sobrenome="Lucatto"/>
        </div>
    ) 

}
